	var colorDex = -1;
	var divisor = -1;
	var URLvars = document.URL.split("?")[1].split("&");
	var dataRequest,comparisonType,comparisonValue,cColor;
	var requestType = -1;
	for(v=0; v<URLvars.length; v++){
		if(URLvars[v].indexOf("q=") == 0){
			dataRequest = URLvars[v].substring(2).toLowerCase();
			requestType = 1;
		}
		else if(URLvars[v].indexOf("c=") == 0){
			dataRequest = URLvars[v].substring(2).toLowerCase();
			requestType = 2;
		}
		else if(URLvars[v].indexOf("cType=") == 0){
			comparisonType = URLvars[v].substring(6).toLowerCase();
		}
		else if(URLvars[v].indexOf("cValue=") == 0){
			comparisonValue = URLvars[v].substring(7).toLowerCase();
		}
		else if(URLvars[v].indexOf("cColor=") == 0){
			cColor = "#" + URLvars[v].substring(7);
		}
	}
	switch(dataRequest){
		case "population":
			colorDex = 2;
			break;
		case "coast":
			colorDex = 9;
			break;
		case "area":
			colorDex = 3;
			break;
		case "density":
			colorDex = 2;
			divisor = 3;
			break;
		case "coast-density":
