		case "statehood":
			colorDex = 8;
			break;
		case "population-1950":
			colorDex = 12;
			break;
		case "density-1950":
			colorDex = 12;
			divisor = 3;
			break;
		case "gdp":
			colorDex = 11;
			break;
		case "gdp-capita":
			colorDex = 11;
			divisor = 2;
			break;
		case "name":
			colorDex = 1;
			divisor = "null";
			break;
	}
if((requestType == 2)&&(comparisonType)&&(comparisonValue)){
	var selectFunction;
	switch(comparisonType){
		case "lesser":
			selectFunction = function(a,b){ return (a<b); };
			break;
		case "greater":
			selectFunction = function(a,b){ return (a>b); };
			break;
		case "equal":
			selectFunction = function(a,b){ return (a==b); };
			break;
	}
	try{
	for(j=0; j<states.length; j++){
		if(divisor == -1){ divideOp = 1; }
		else{ divideOp = states[j][divisor]; }
		var stateCode = states[j][0];
		var labelColor = cColor;
		var altColor = "#999999";
		if(selectFunction( (states[j][colorDex]/divideOp),comparisonValue )){
			document.getElementById(stateCode).style.setProperty('fill',labelColor,'important');
		}
		else{
			if((divisor == "null")&&(selectFunction(states[j][colorDex].toLowerCase(),unescape(comparisonValue) ))){
				document.getElementById(stateCode).style.setProperty('fill',labelColor,'important');
			}
			else{
				document.getElementById(stateCode).style.setProperty('fill',altColor,'important');
			}
		}
	}
	}catch(e){ }
}
if((requestType == 1)&&(colorDex != -1)){	// find minimum and maximum values
	var minVal = null;
	var maxVal = null;
	var divideOp;
	for(i=0; i<states.length; i++){
		if(divisor == -1){ divideOp = 1; }
		else{ divideOp = states[i][divisor]; }
		var thisVal = states[i][colorDex] / divideOp;
		if (minVal == null || minVal > thisVal){ minVal = thisVal; }
		if (maxVal == null || maxVal < thisVal){ maxVal = thisVal; }
	}
	minVal -= 0.005 * (maxVal - minVal);
	maxVal += 0.15 * (maxVal - minVal);
	// color map
	var colorScale =  256 / (maxVal - minVal);
	var stateCode;
	try{
	for(j=0; j<states.length; j++){
		if(divisor == -1){ divideOp = 1; }
		else{ divideOp = states[j][divisor]; }
		stateCode = states[j][0];
		var labelColor = 256 - Math.floor(colorScale * ((states[j][colorDex]/divideOp) - minVal));
		var blueScale = 16 + Math.floor(0.1 * labelColor);
		var redScale = 55 + Math.floor(0.4 * labelColor);
		blueScale = (blueScale-0).toString(16);
		redScale = (redScale-0).toString(16);
		if(labelColor <= 15.5){
			labelColor = (labelColor-0).toString(16);
			document.getElementById(stateCode).style.setProperty('fill','#' + redScale + '0' + labelColor + '' + blueScale,'important');
		}
		else{
			labelColor = (labelColor-0).toString(16);
			document.getElementById(stateCode).style.setProperty('fill','#' + redScale + '' + labelColor + '' + blueScale,'important');
		}
	}
	}catch(e){  alert(stateCode); }
  }
